import React from 'react';

const Home = ({ setCurrentPage }) => {
  return (
    <div className="home-container">
      <h1>Bienvenido</h1>
      <div className="button-container">
        <button onClick={() => setCurrentPage('cargaReloj')}>Carga Reloj</button>
        <button onClick={() => setCurrentPage('cargaHorario')}>Carga Horario</button>
        <button>No Funcional</button>
      </div>
    </div>
  );
};

export default Home;
